import React from 'react'
import Link from 'react-router-dom'

const HomeScreen = () => {
  return (
    <div>
      <h1>Student Class Tracker Tool</h1>
      <Link to='/search'>
        Search
      </Link>
      <Link to='/search'>
        Details
      </Link>
    </div>
  );
}

export default HomeScreen;
